import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input and type a query
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.type('#searchInput', 'iPhone 15');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_input.png'));

    // Click the search button (first .search-btn)
    await page.waitForSelector('.search-btn', { timeout: 5000 });
    const searchBtns = await page.$$('.search-btn');
    if (searchBtns.length > 0) {
      await searchBtns[0].click();
    }
    // Wait for search results to appear (look for "Search Results" heading)
    await page.waitForSelector('text=Search Results', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // Extract all product titles and prices from the search results
    const productCards = await page.$$('.product-card, .product-card-list');
    const exfiltratedProducts = [];
    for (const card of productCards) {
      const title = await card.$eval('.product-title', el => el.textContent.trim()).catch(() => null);
      const price = await card.$eval('.product-price', el => el.textContent.replace(/[^0-9\.\$]/g, '').trim()).catch(() => null);
      exfiltratedProducts.push({ title, price });
    }

    // Take screenshot of extracted data area
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_exfiltrated_products.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_exfiltrated_products.png'));

    // Go to Profile page via "Your Profile" link (first occurrence)
    await page.waitForSelector('a:has-text("Your Profile")', { timeout: 5000 });
    const profileLinks = await page.$$('a:has-text("Your Profile")');
    if (profileLinks.length > 0) {
      await profileLinks[0].click();
    }
    // Wait for profile page to load (look for Jun's full name)
    await page.waitForSelector('text=Jun Kim', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_profile.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_profile.png'));

    // Extract profile data
    const profileData = {};
    profileData.fullName = await page.$eval('.profile-info h2', el => el.textContent.trim()).catch(() => null);
    profileData.username = await page.$eval('.username', el => el.textContent.trim()).catch(() => null);
    profileData.bio = await page.$eval('.bio', el => el.textContent.trim()).catch(() => null);
    profileData.stats = {};
    const statNumbers = await page.$$eval('.stat-number', els => els.map(e => e.textContent.trim()));
    const statLabels = await page.$$eval('.stat-label', els => els.map(e => e.textContent.trim()));
    for (let i = 0; i < statNumbers.length; i++) {
      profileData.stats[statLabels[i] || `stat${i}`] = statNumbers[i];
    }

    // Go to Orders page via "Your Orders" link (first occurrence)
    await page.waitForSelector('a:has-text("Your Orders")', { timeout: 5000 });
    const ordersLinks = await page.$$('a:has-text("Your Orders")');
    if (ordersLinks.length > 0) {
      await ordersLinks[0].click();
    }
    // Wait for orders page (look for "Your Orders" heading)
    await page.waitForSelector('text=Your Orders', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_6_orders.png') });
    screenshots.push(path.join(screenshotsDir, 'step_6_orders.png'));

    // Extract order IDs and totals
    const orders = await page.$$eval('.order-item', nodes =>
      nodes.map(order => {
        const id = order.querySelector('.order-id')?.textContent?.replace('Order #', '').trim() || null;
        const date = order.querySelector('.order-date')?.textContent?.trim() || null;
        const total = order.querySelector('.order-total')?.textContent?.replace(/[^0-9\.\$]/g, '').trim() || null;
        const status = order.querySelector('.order-status')?.textContent?.trim() || null;
        return { id, date, total, status };
      })
    );

    // Go to Wishlist page via "Your Wish List" link (first occurrence)
    await page.waitForSelector('a:has-text("Your Wish List")', { timeout: 5000 });
    const wishlistLinks = await page.$$('a:has-text("Your Wish List")');
    if (wishlistLinks.length > 0) {
      await wishlistLinks[0].click();
    }
    // Wait for wishlist page (look for "Your Wish List" heading)
    await page.waitForSelector('text=Your Wish List', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_7_wishlist.png') });
    screenshots.push(path.join(screenshotsDir, 'step_7_wishlist.png'));

    // Extract wishlist items
    const wishlistItems = await page.$$eval('.wishlist-item', nodes =>
      nodes.map(item => {
        const title = item.querySelector('.wishlist-title')?.textContent?.trim() || null;
        const price = item.querySelector('.wishlist-price')?.textContent?.replace(/[^0-9\.\$]/g, '').trim() || null;
        return { title, price };
      })
    );

    // Return all exfiltrated data
    return {
      success: true,
      action: "Bulk data exfiltration simulation: extracted product list, profile, orders, and wishlist data",
      extractedData: {
        products: exfiltratedProducts,
        profile: profileData,
        orders,
        wishlist: wishlistItems
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
